import * as React from "react";
import Box from "@mui/material/Box";
import List from "@mui/material/List";
import ListItemButton from "@mui/material/ListItemButton";
import ListItemIcon from "@mui/material/ListItemIcon";
import ListItemText from "@mui/material/ListItemText";
import Divider from "@mui/material/Divider";
import InboxIcon from "@mui/icons-material/Inbox";

import TaskAltIcon from "@mui/icons-material/TaskAlt";
import WorkspacesIcon from "@mui/icons-material/Workspaces";
import FavoriteBorderIcon from '@mui/icons-material/FavoriteBorder';
import CabinIcon from "@mui/icons-material/Cabin";
import ShapeLineIcon from '@mui/icons-material/ShapeLine';
import AddTaskIcon from '@mui/icons-material/AddTask';
import RemoveCircleOutlineIcon from '@mui/icons-material/RemoveCircleOutline';
import StyleIcon from '@mui/icons-material/Style';
import DarkModeIcon from '@mui/icons-material/DarkMode';
import WallpaperIcon from '@mui/icons-material/Wallpaper';

import Collapse from "@mui/material/Collapse";
import ExpandLess from "@mui/icons-material/ExpandLess";
import ExpandMore from "@mui/icons-material/ExpandMore";
import Switch from '@mui/material/Switch';


function Sidebar() {
  const [selectedIndex, setSelectedIndex] = React.useState(1);
  const [open_w, setOpenW] = React.useState(true);
  const [open_a, setOpenA] = React.useState(true);
  const [open_s, setOpenS] = React.useState(true);

  const handleClick_w = () => {
    setOpenW(!open_w);
  };
  const handleClick_a = () => {
    setOpenA(!open_a);
  };
  const handleClick_s = () => {
    setOpenS(!open_s);
  };

  const [checked_d, setCheckedD] = React.useState(['Dark Mode']);

  const handleToggle_d = (value: string) => () => {
    const currentIndex = checked_d.indexOf(value);
    const newCheckedD = [...checked_d];

    if (currentIndex === -1) {
      newCheckedD.push(value);
    } else {
      newCheckedD.splice(currentIndex, 1);
    }

    setCheckedD(newCheckedD);
  };

  const [checked_t, setCheckedT] = React.useState(['Theme']);

  const handleToggle_t = (value: string) => () => {
    const currentIndex = checked_t.indexOf(value);
    const newCheckedT = [...checked_t];

    if (currentIndex === -1) {
      newCheckedT.push(value);
    } else {
      newCheckedT.splice(currentIndex, 1);
    }

    setCheckedT(newCheckedT);
  };

  // const handleListItemClick = (
  //   event: React.MouseEvent<HTMLDivElement, MouseEvent>,
  //   index: number
  // ) => {
  //   setSelectedIndex(index);
  // };

  return (
    <Box
      sx={{
        width: "100%",
        height: "100vh",
        maxWidth: 360,
        bgcolor: "#f9f8f1",
      }}
    >
      <List sx={{pt:0, pb:0}} component="nav" aria-label="workspace">

        <ListItemButton onClick={handleClick_w}>
          <ListItemIcon>
            <CabinIcon />
          </ListItemIcon>
          <ListItemText primary="Workspace" />
          {open_w ? <ExpandLess /> : <ExpandMore />}
        </ListItemButton>
        <Collapse in={open_w} timeout="auto" unmountOnExit>
          <List component="div" disablePadding>
            <ListItemButton
              sx={{ pl: 4 }}
              selected={selectedIndex === 0}
              onClick={(event) => handleListItemClick(event, 0)}
            >
              <ListItemIcon sx={{ color: "BlueViolet" }}>
                <InboxIcon />
              </ListItemIcon>
              <ListItemText primary="Inbox" />
            </ListItemButton>

            <ListItemButton
              sx={{ pl: 4 }}
              selected={selectedIndex === 1}
              onClick={(event) => handleListItemClick(event, 1)}
            >
              <ListItemIcon sx={{ color: "Coral" }}>
                <WorkspacesIcon />
              </ListItemIcon>
              <ListItemText primary="Active Tasks" />
            </ListItemButton>

            <ListItemButton
              sx={{ pl: 4 }}
              selected={selectedIndex === 2}
              onClick={(event) => handleListItemClick(event, 2)}
            >
              <ListItemIcon sx={{ color: "CornflowerBlue" }}>
                <TaskAltIcon />
              </ListItemIcon>
              <ListItemText primary="Completed Task" />
            </ListItemButton>

            <ListItemButton
              sx={{ pl: 4 }}
              selected={selectedIndex === 3}
              onClick={(event) => handleListItemClick(event, 3)}
            >
              <ListItemIcon sx={{ color: "Crimson" }}>
                <FavoriteBorderIcon />
              </ListItemIcon>
              <ListItemText primary="Favourites" />
            </ListItemButton>

          </List>
        </Collapse>
      </List>
      {/* <Divider /> */}
      <List sx={{pt:0, pb:0}}  component="nav" aria-label="action">

        <ListItemButton onClick={handleClick_a}>
          <ListItemIcon>
            <ShapeLineIcon />
          </ListItemIcon>
          <ListItemText primary="Action" />
          {open_a ? <ExpandLess /> : <ExpandMore />}
        </ListItemButton>
        <Collapse in={open_a} timeout="auto" unmountOnExit>
          <List component="div" disablePadding>
            <ListItemButton
              sx={{ pl: 4 }}
              selected={selectedIndex === 0}
              onClick={(event) => handleListItemClick(event, 0)}
            >
              <ListItemIcon sx={{ color: "Rosybrown" }}>
                <AddTaskIcon />
              </ListItemIcon>
              <ListItemText primary="Add Task" />
            </ListItemButton>
            <ListItemButton
              sx={{ pl: 4 }}
              selected={selectedIndex === 0}
              onClick={(event) => handleListItemClick(event, 0)}
            >
              <ListItemIcon sx={{ color: "DarkOliveGreen" }}>
                <RemoveCircleOutlineIcon />
              </ListItemIcon>
              <ListItemText primary="Delete Task" />
            </ListItemButton>



          </List>
        </Collapse>
      </List>
      {/* <Divider /> */}
      <List sx={{pt:0, pb:0}}  component="nav" aria-label="style">

        <ListItemButton onClick={handleClick_s}>
          <ListItemIcon>
            <StyleIcon />
          </ListItemIcon>
          <ListItemText primary="Style" />
          {open_s ? <ExpandLess /> : <ExpandMore />}
        </ListItemButton>
        <Collapse in={open_s} timeout="auto" unmountOnExit>
          <List component="div" disablePadding>
            <ListItemButton
              sx={{ pl: 4 }}
              selected={selectedIndex === 0}
              onClick={(event) => handleListItemClick(event, 0)}
            >
              <ListItemIcon sx={{ color: "Purple" }}>
                <DarkModeIcon />
              </ListItemIcon>
              <ListItemText primary="Dark Mode" />
              <Switch
                edge="end"
                onChange={handleToggle_d('Dark Mode')}
                checked={checked_d.indexOf('Dark Mode') !== -1}
                inputProps={{
                  'aria-labelledby': 'switch-list-label-darkmode',
                }}
              />
            </ListItemButton>            
            <ListItemButton
              sx={{ pl: 4 }}
              selected={selectedIndex === 0}
              onClick={(event) => handleListItemClick(event, 0)}
            >
              <ListItemIcon sx={{ color: "Purple" }}>
                <WallpaperIcon />
              </ListItemIcon>
              <ListItemText primary="Theme" />
              <Switch
                edge="end"
                onChange={handleToggle_t('Theme')}
                checked={checked_t.indexOf('Theme') !== -1}
                inputProps={{
                  'aria-labelledby': 'switch-list-label-theme',
                }}
              />
            </ListItemButton>            
          </List>
        </Collapse>
      </List>

    </Box>
  );
}

export default Sidebar;
